  false,\n\t\"url\": null,\n\t\"notes\": \"This proposal is submitted with the intention
  of maximizing the long term quality and quantity of undisturbed cover and in particular
  preferred nesting cover for upland nesting birds.  It is made acknowledging the
  fact that AUM utilization by present refuge grazing permittees, be maintained as
  it has been since 1985. The greatest problems of implementation will probably be
  planning to reduce the distance and difficulty of moving stock, separation of different
  permit tee's stock and classes of stock; a insuring that grazing facilities (fencing
  and water) are up to standard . Habitat management of potential nesting cove r ,
  unlike influences caused by weather, are within our management capability . Therefore,
  the basic thrust proposed is to target disturbed grassland acreages, grazed since
  mid-summer or the previous year, for grazing treatment through June 30 of the current
  year.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
